def my_func(expression: str) -> bool:
    # Helper function to evaluate expressions with a single operator type
    def eval_single_operator(expr, operator):
        if operator == '&':
            return all(c == 't' for c in expr.split('&'))
        elif operator == '|':
            return any(c == 't' for c in expr.split('|'))

    # First, evaluate all '&' operations since they have higher precedence
    parts = expression.split('|')
    and_evaluated = ['t' if eval_single_operator(part, '&') else 'f' for part in parts]

    # Then, evaluate the resulting expression with '|'
    result = eval_single_operator('|'.join(and_evaluated), '|')
    return result

# Example usage:
# print(my_func("f|t&f&f|f&f|f&f&t|t"))  # Output: True
